import React from 'react';
import {Component} from 'react'
import './TheBlog.scss'
import axios from 'axios'

export default class TheBlog extends Component{
    constructor(props){
        super(props);
        this.state={
            articles:[]
        }
    }
    componentDidMount() {
        axios
          .get("http://localhost:5000/articles/")
          .then((response) => {
            console.log(response)
            this.setState({
              projects: Object.values(response.data),
            });
          })
      }

    render(){

            <div>
                <div className="font5 theBlogTitle">
                    Damn Good Resources
                </div>
                <div className="font2 theBlogSubtitle">
                    To afraid to change your mind?
                </div>
            </div>

let title = (
    <div key={0} className="showcasesRow row">
      <div className="col-10 col-sm-10 col-md-10 col-lg-10 col-xl-10 offset-1 offset-sm-1 offset-md-1 offset-lg-1 offset-xl-1">
        <span>
          <i id="wedo" className="showcasesArrow icono-arrow1-right"></i>
        </span>
        <div className="font1 showCasesTitle">Showcases</div>

        <div className="font2 showCasesSubtitle">Not only blablablabla.</div>
      </div>
    </div>
  );
  let moreComing = (
    <div key={99} className="showcasesEnd row">
      <div className="col-10 col-sm-10 col-md-10 col-lg-10 col-xl-10 offset-1 offset-sm-1 offset-md-1 offset-lg-1 offset-xl-1">
        <span>
          <i className="moreComingArrow icono-arrow1-right"></i>
        </span>
        <div className="font6 moreComing">More coming soon.</div>
      </div>
    </div>
  );


  if (this.state.projects) {
    return [
      title,<div key={199} className="showcasesList">
      {this.state.projects.map((project, i) => {

          return (
              <Showcase
                     key={i}
                     id={project._id}
                     imgLink='https://digital-photography-school.com/wp-content/uploads/2012/10/image1.jpg'
                     title={`${project.showcaseTitle}`}
                     serviceType={`${project.serviceType}`}
              />
          );
      })}</div>,
    moreComing];
  }
}




}
